        return instance
            .post('https://sendsay.ru/backend/tilda/1QEeXj5ALOZM3KoBqYbsSLP1Kq1YM55pFB1i4sb4', {data})
            .then((response) => {
                console.log(response)
            })
            .catch((error) => {
                console.error('Ошибка при отправке запроса formSubmits:', error);
